#services{
    padding:100px 0 50px;
    background: $dark-blue;

    .services__title{
        color:$white;
        background:none;
        text-align: center;
    }
    .services__text{
        padding:30px 30px 20px;
        color:$grey;
    }

    .services__list{
       margin-top:40px;
       justify-content: center;
       align-items: center;
       padding-top:20px;
       background: none;
        &-links{
            background:none;
            padding:50px 40px 20px;
            img{
                
                box-shadow: 3px 3px 3px rgb(32, 32, 32);
            }
            h2{
                background:none; 
                padding:15px 0;
                color:$white;
                font-weight: 400;
                text-align:center;
                letter-spacing: 3px;
            }
        }
    }
}
@include tablet {
    #services {
        padding:100px 50px;

        .services__list {
            
            &-links {
                display: flex;
                flex-wrap: nowrap;
                align-items: center;
                justify-content:space-around;
                              
                h2 {
                    padding:10px;
                    font-size:min(1.3rem);           
                }
               
            }
            #kitchenBoxBackground,
            #loftBoxBackground,
            #groundworkBoxBackground {
                display:flex;
                flex-direction: row-reverse;
                flex-wrap: nowrap;  
            }
            
        }
    }
}

@include desktop {
    #services{
        padding:50px 100px;

        .services__text{
            padding:30px 100px;
         
        }
        .services__list{
           display:flex;
           flex-wrap: wrap;
           
            &-links{
                display:flex;
                flex-wrap: nowrap;
                flex-direction:column;
                align-items: center;
                width:33%;
                padding: 30px 30px 0;
              
                h2{
                    background:none; 
                    padding:12px 0;
                    color:$white;
                    font-weight: 400;
                    text-align:center;
                    letter-spacing: 3px;
                    height:50px;
                }
            }

            #kitchenBoxBackground,
            #loftBoxBackground,
            #groundworkBoxBackground {
                display:flex;
                flex-direction:column;
                flex-wrap: nowrap;   
            }
        }
    }
}
@include largeDesktop {
    #services {
        padding:100px 150px;
        
        .services__text{
            padding:30px 200px;  
        }
        
    }
}

